// App.js
import React from "react";
import { Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Home from "./components/Home"; // Componente para la página de inicio
import Users from "./components/Users"; // Componente para la página de usuarios
import Admin from "./components/Admin"; // Componente para la página de administrador

const App = () => {
  return (
    <div>
      <Navbar />
      <Switch>
        <Route path="/users" component={Users} />
        <Route path="/admin" component={Admin} />
        <Route path="/" component={Home} />
      </Switch>
    </div>
  );
};

export default App;
